    data: |
      SELECT + + col2 + + col2 FROM tab0 WHERE NOT col2 * + + col0 BETWEEN ( + 73 ) + + col2 + - col0 AND + + 17 * - ( + col0 ) * + + 96;
  - name: tab0

outputs:
  - name: q6503.out
    data: |
      198
      20
      94
